    <title>Tree Wiggle Animation</title>

    <style>
      * {
        margin: 0;
        padding: 0;
        box-sizing: border-box;
      }

      .parentDiv {
        min-height: 100vh;
        display: grid;
        place-items: center;
      }

      .wrapper {
        width: auto;
        max-height: 100vh;
      }

      #top-left {
        transform: rotate(-2deg);
        transform-box: fill-box;
        transform-origin: 100px bottom;
        animation: wiggle 5s ease-in-out infinite alternate;
      }

      #top-bottom-left {
        transform: rotate(3deg);
        transform-box: fill-box;
        transform-origin: calc(100% - 33px) bottom;
        animation: wiggle 5s ease-in-out 0.2s infinite alternate-reverse;
      }

      #top-mid-left {
        transform: rotate(-2deg);
        transform-box: fill-box;
        transform-origin: 83px bottom;
        animation: wiggle 5s ease-in-out 0.4s infinite alternate;
      }

      #bottom-mid-left {
        transform: rotate(3deg);
        transform-box: fill-box;
        transform-origin: 11px bottom;
        animation: wiggle 5s ease-in-out 0.6s infinite alternate-reverse;
      }

      #bottom-top-left {
        transform: rotate(-2deg);
        transform-box: fill-box;
        transform-origin: 30px bottom;
        animation: wiggle 5s ease-in-out 0.4s infinite alternate;
      }

      #bottom-left {
        transform: rotate(3deg);
        transform-box: fill-box;
        transform-origin: 101px bottom;
        animation: wiggle 5s ease-in-out 0.2s infinite alternate-reverse;
      }

      @keyframes wiggle {
        0% {
          transform: rotate(-2deg);
        }

        100% {
          transform: rotate(3deg);
        }
      }
    </style>
